import React from 'react';
import './App.css';

import HucksLogo from './Components/HucksLogo';
import Greetings from './Components/Greetings';
import Footer from './Components/Footer'
import Nav from './Components/Nav'
import { CSSTransition } from 'react-transition-group';



import { BrowserRouter, Route } from 'react-router-dom';


function App() {
  return (
    <div className="App">
     < BrowserRouter>

     <Route exact path="/" component={HucksLogo}/>
      <Route exact path="/" component={Greetings}/>

      <CSSTransition 
      in={console.log('in')}
      timeout={500} 
      classNames="trans_group" appear={true}


      >


      <Route  path="/hucksapp" component={Nav}/>

     </CSSTransition>
    </BrowserRouter>
    <Footer/>
    </div>
  );
}

export default App;
